import './header.css';
import Signout from '../Button/signOut';
import StreakosLogo from '../../assets/images/Streakos.svg';
import Light from '../Light/light';

export default function Header(){
    return(
        <nav className="nav">
            <div className="logo">
                <img className="image" src={StreakosLogo} alt="logo"/>
            </div>
            <div className="button-signout">
                 <Signout />
            </div>
            <div className="button-light">
                <Light />
            </div>
        </nav>
    )
}
